import React, { Component } from 'react';
import './notFound.css';

const notFound = () => {
    return ( 
    <React.Fragment>
        <h1>OOPS!</h1>
        <p>The page you are looking for can't be found</p>
        <button>Go To Home</button>
    </React.Fragment>
 );
}
 
export default notFound;
